import TextEditor from './components/TextEditor'
import {
  BrowserRouter,
  Routes,
  useNavigate,
  Route
} from 'react-router-dom';
import {v4 as uniqueId} from 'uuid';

function App() {

  const navigate = useNavigate()

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" exact>
        <Navigate to={(`/documents/${uniqueId()}`)}/>
        </Route>
        <Route path="/documents/:id" element={<TextEditor/>}>

        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
